import React from 'react'

const Selection = ({ selectionList }) => {

    var currentSelection = "Selected nodes: \n"
    selectionList.map(node => (
        currentSelection += node + "\n"
    ));

    return (
        <div className='card grid-1'>
            {currentSelection}
        </div>
    )
}

export default Selection;
